import React from 'react';
import { withRouter, Link } from 'react-router-dom';
import Truncate from 'react-truncate';


const BuildingList = (props) => {
    return (
      <React.Fragment>
        <div className="col-md-6 col-12">
          <div className="card-box border shadow-sm mx-1 my-3">
            <div className="card-box__display-img">
              <img src={props.building.image} alt=""/>
            </div>
            <div className="card-box__title px-3 py-3">
              {props.building.name}
            </div>
            <div className="card-box__address">
              <Truncate className="px-3" lines={1}>
                {props.building.street}
              </Truncate>
            </div>
            <div className="card-box__location px-2 pt-2">
              <i className="material-icons mr-1">location_on</i>
              {props.building.city}
            </div>
          </div>
        </div>
      </React.Fragment>
    )
}

export default (withRouter(BuildingList));
